import React, { useState, useEffect, useRef } from 'react';
import './navbar.css';
import io from './icon/control-center.png';
import siri from './icon/siri.png';
import Dock from './Dock';
import Clock from './Clock';

export default function Navbar() {
  const [dropdownApple, setDropdownApple] = useState(false);
  const [dropdownFinder, setDropdownFinder] = useState(false);
  const [dropdownFile, setDropdownFile] = useState(false);
  const [dropdownEdit, setDropdownEdit] = useState(false);
  const [dropdownView, setDropdownView] = useState(false);
  const [dropdownGo, setDropdownGo] = useState(false);
  const [dropdownWindow, setDropdownWindow] = useState(false);
  const [dropdownHelp, setDropdownHelp] = useState(false);
  const [dropdownWifi, setDropdownWifi] = useState(false);
  const [dropdownSearch, setDropdownSearch] = useState(false);
  const [dropdownControlCentre, setDropdownControlCentre] = useState(false);
  const [batteryLevel, setBatteryLevel] = useState(null);
  const [isCharging, setIsCharging] = useState(null);
  const [isDropdownOpen, setIsDropdownOpen] = useState(false);
  const [checkValue, setCheckValue] = useState(false);
  const [wifiInfo, setWifiInfo] = useState(false);
  const navbarRef = useRef(null);

  const toggleDropdown = (dropdownStateSetter) => {
    closeDropdowns();
    dropdownStateSetter(true);
  };

  const closeDropdowns = () => {
    setDropdownApple(false);
    setDropdownFinder(false);
    setDropdownFile(false);
    setDropdownEdit(false);
    setDropdownView(false);
    setDropdownGo(false);
    setDropdownWindow(false);
    setDropdownHelp(false);
    setDropdownWifi(false);
    setDropdownSearch(false);
    setDropdownControlCentre(false);
    setIsDropdownOpen(false);
  };

  const handleClickOutside = (event) => {
    if (navbarRef.current && !navbarRef.current.contains(event.target)) {
      closeDropdowns();
    }
  };

  useEffect(() => {
    document.addEventListener('mousedown', handleClickOutside);
    return () => {
      document.removeEventListener('mousedown', handleClickOutside);
    };
  }, []);

  useEffect(() => {
    if ('getBattery' in navigator) {
      navigator.getBattery().then(function (battery) {
        updateBatteryStatus(battery);

        battery.addEventListener('levelchange', () => {
          updateBatteryStatus(battery);
        });

        battery.addEventListener('chargingchange', () => {
          updateBatteryStatus(battery);
        });
      });

      const intervalId = setInterval(() => {
        navigator.getBattery().then(function (battery) {
          updateBatteryStatus(battery);
        });
      }, 1000);
      return () => {
        clearInterval(intervalId);
      };
    } else {
      console.log('Battery API not supported in this browser.');
    }
  }, []);

  const togglebattery = () => {
    closeDropdowns();
    setIsDropdownOpen(!isDropdownOpen);
  };

  const toggleWifi = () => {
    closeDropdowns();
    setDropdownWifi(!dropdownWifi);
  };

  const toggleSearch = () => {
    closeDropdowns();
    setDropdownSearch(!dropdownSearch);
  };

  const toggleControlCentre = () => {
    closeDropdowns();
    setDropdownControlCentre(!dropdownControlCentre);
  };

  const WifiOn = () => {
    if (checkValue === false) {
      setCheckValue(true);
      setWifiInfo(!wifiInfo);
    }
  };

  const WifiOff = () => {
    if (checkValue === true) {
      setCheckValue(false);
      setWifiInfo(!wifiInfo);
    }
  };

  const updateBatteryStatus = (battery) => {
    setBatteryLevel((battery.level * 100).toFixed(0));
    setIsCharging(battery.charging);
  };

  return (
    <body>
      <div className="nav" ref={navbarRef}>
        <img className="nav-apple" src={io} alt="apple" onClick={() => toggleDropdown(setDropdownApple)} />
        <div className="nav-space"></div>
        <div className={`dropdown ${dropdownApple ? 'show' : ''}`}>
          <ul>
            <li>
              <a href="#">About This Mac</a>
            </li>
            <li>
              <a href="#">System Preferences</a>
            </li>
            <li>
              <a href="#">App Store</a>
            </li>
            <li>
              <a href="#">Recent Items</a>
            </li>
            <li>
              <a href="#">Force Quit</a>
            </li>
            <li>
              <a href="#">Sleep</a>
            </li>
            <li>
              <a href="#">Restart</a>
            </li>
            <li>
              <a href="#">Shut Down</a>
            </li>
          </ul>
        </div>

        <img className="nav-finder" src={io} alt="finder" onClick={() => toggleDropdown(setDropdownFinder)} />
        <div className={`dropdown ${dropdownFinder ? 'show' : ''}`}>
          <ul>
            <li>
              <a href="#">About Finder</a>
            </li>
            <li>
              <a href="#">Preferences</a>
            </li>
            <li>
              <a href="#">Empty Trash</a>
            </li>
            <li>
              <a href="#">Secure Empty Trash</a>
            </li>
            <li>
              <a href="#">Services</a>
            </li>
            <li>
              <a href="#">Hide Finder</a>
            </li>
            <li>
              <a href="#">Hide Others</a>
            </li>
            <li>
              <a href="#">Show All</a>
            </li>
          </ul>
        </div>

        <img className="nav-file" src={io} alt="file" onClick={() => toggleDropdown(setDropdownFile)} />
        <div className={`dropdown ${dropdownFile ? 'show' : ''}`}>
          <ul>
            <li>
              <a href="#">New File</a>
            </li>
            <li>
              <a href="#">Open</a>
            </li>
            <li>
              <a href="#">Save</a>
            </li>
            <li>
              <a href="#">Save As</a>
            </li>
            <li>
              <a href="#">Close</a>
            </li>
          </ul>
        </div>

        <img className="nav-edit" src={io} alt="edit" onClick={() => toggleDropdown(setDropdownEdit)} />
        <div className={`dropdown ${dropdownEdit ? 'show' : ''}`}>
          <ul>
            <li>
              <a href="#">Undo</a>
            </li>
            <li>
              <a href="#">Redo</a>
            </li>
            <li>
              <a href="#">Cut</a>
            </li>
            <li>
              <a href="#">Copy</a>
            </li>
            <li>
              <a href="#">Paste</a>
            </li>
            <li>
              <a href="#">Delete</a>
            </li>
            <li>
              <a href="#">Select All</a>
            </li>
          </ul>
        </div>

        <img className="nav-view" src={io} alt="view" onClick={() => toggleDropdown(setDropdownView)} />
        <div className={`dropdown ${dropdownView ? 'show' : ''}`}>
          <ul>
            <li>
              <a href="#">View Options</a>
            </li>
            <li>
              <a href="#">Sort By</a>
            </li>
            <li>
              <a href="#">Clean Up</a>
            </li>
            <li>
              <a href="#">Show/Hide Path Bar</a>
            </li>
            <li>
              <a href="#">Show/Hide Status Bar</a>
            </li>
          </ul>
        </div>

        <img className="nav-go" src={io} alt="go" onClick={() => toggleDropdown(setDropdownGo)} />
        <div className={`dropdown ${dropdownGo ? 'show' : ''}`}>
          <ul>
            <li>
              <a href="#">Back</a>
            </li>
            <li>
              <a href="#">Forward</a>
            </li>
            <li>
              <a href="#">Home</a>
            </li>
            <li>
              <a href="#">Applications</a>
            </li>
            <li>
              <a href="#">Documents</a>
            </li>
            <li>
              <a href="#">Downloads</a>
            </li>
            <li>
              <a href="#">Utilities</a>
            </li>
          </ul>
        </div>

        <img className="nav-window" src={io} alt="window" onClick={() => toggleDropdown(setDropdownWindow)} />
        <div className={`dropdown ${dropdownWindow ? 'show' : ''}`}>
          <ul>
            <li>
              <a href="#">Minimize</a>
            </li>
            <li>
              <a href="#">Zoom</a>
            </li>
            <li>
              <a href="#">Cycle Through Windows</a>
            </li>
            <li>
              <a href="#">Bring All to Front</a>
            </li>
          </ul>
        </div>

        <img className="nav-help" src={io} alt="help" onClick={() => toggleDropdown(setDropdownHelp)} />
        <div className={`dropdown ${dropdownHelp ? 'show' : ''}`}>
          <ul>
            <li>
              <a href="#">macOS Help</a>
            </li>
            <li>
              <a href="#">App Help</a>
            </li>
            <li>
              <a href="#">Support</a>
            </li>
            <li>
              <a href="#">Community</a>
            </li>
            <li>
              <a href="#">Keyboard Shortcuts</a>
            </li>
          </ul>
        </div>

        <div className="nav-icon">
          <img className="nav-siri" src={siri} alt="siri" onClick={() => toggleDropdown(setDropdownSearch)} />
          <img
            className="nav-control"
            src={io}
            alt="control center"
            onClick={() => toggleDropdown(setDropdownControlCentre)}
          />
          <div className={`dropdown ${dropdownControlCentre ? 'show' : ''}`}>
            <ul>
              <li>
                <label className="switch">
                  <input type="checkbox" checked={checkValue} onChange={checkValue ? WifiOff : WifiOn} />
                  <span className="slider round"></span>
                </label>
                <p>{checkValue ? 'Wi-Fi On' : 'Wi-Fi Off'}</p>
              </li>
            </ul>
          </div>
        </div>
        <div className={`dropdown ${dropdownWifi ? 'show' : ''}`}>
          <ul>
            <li>
              <a href="#">Wi-Fi Network 1</a>
            </li>
            <li>
              <a href="#">Wi-Fi Network 2</a>
            </li>
            <li>
              <a href="#">Wi-Fi Network 3</a>
            </li>
            <li>
              <a href="#">Wi-Fi Network 4</a>
            </li>
          </ul>
        </div>
        <div className={`dropdown ${dropdownSearch ? 'show' : ''}`}>
          <ul>
            <li>
              <input type="text" placeholder="Type here..." />
            </li>
          </ul>
        </div>
      </div>
      <div className={`battery-dropdown ${isDropdownOpen ? 'show' : ''}`}>
        <p>Battery Level: {batteryLevel}%</p>
        <p>{isCharging ? 'Charging' : 'Not Charging'}</p>
      </div>
      <Clock />
      <Dock />
    </body>
  );
}
